const ProgressBar = ({ progressPercentage }) => {
    const classNames = []
    if (progressPercentage > 75) {
      classNames.push("bg-[#FD3C4A]")
    } if (50 < progressPercentage < 75) {
      classNames.push("bg-[#FCAC12]")
    }else {
        classNames.push("bg-[#00A86B]")
    }

    return (

        <div className="mb-4 w-60 h-4 bg-gray-200 rounded-full dark:bg-gray-700">
        <div className={classNames.join(" ")}>
            <div className="h-4 bg-blue-600 rounded-full dark:bg-blue-500" style={{width:progressPercentage}}></div>
            </div>
        </div>

    );
};

export default ProgressBar;
